import { AST } from "eslint";
import React from "react";
import * as S from "./styled";
import { FaComment } from "react-icons/fa";
import profile from "../../assets/profile.jpg";

export type CardProps = {
  profile_image?: string;
  nickName: string;
  text_post: string;
  title?: string;
};

const CardPost: React.FC<CardProps> = ({
  nickName,
  profile_image,
  text_post,
  title,
}) => {
  return (
    <S.Wrapper>
      <S.ProfileImage>
        <img src={profile} alt="" />
      </S.ProfileImage>
      <S.ContainerText>
        <h3>{nickName} </h3>
        <span> 15 dias atras </span>
        <div>
          <p>{text_post}</p>
        </div>
        <S.IconWrapper>
          <S.PostText>
            Comentarios <FaComment />
          </S.PostText>
        </S.IconWrapper>
      </S.ContainerText>
    </S.Wrapper>
  );
};

export default CardPost;
